import React, { useState } from 'react';
import styled from 'styled-components';


const HomeMyStocksMainHeader = () => {


  // Header
  const Header = styled.div`
    height: 56px;
    min-height: 56px;
    display: flex;
    align-items: center;
    border-top-width: 2px;
    border-top-color: #32323e;
    color: #8f94ab;
    width: 100%;
`;

  const HeaderItem = styled.div`
    display: inline-flex;
    white-space: nowrap;
    font-size: 14px;
    padding-left:2rem;
    align-items: center;
    height: 50px;
    width: 110px;
    max-width: 110px;
    min-width: 110px;
    border-bottom: 1px solid grey;

`;




  const list = ['Price', 'Today % Change', 'Today $ Change', 'YTD Return', 'Market Cap', 'Prev Close', '52 Week High', '52 Week Low'];

  const menu = list.map((ele, i) =>
    // <HeaderItem text={ele} key={i} selected={i} />
    <HeaderItem>{ele}</HeaderItem>
  )




  return (

    <Header>
      {menu}
    </Header>
  );
}

export default HomeMyStocksMainHeader;
